import React, { Component } from 'react';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import FiberManualRecordIcon from '@material-ui/icons/FiberManualRecord';

class Menu extends Component {

    render() { 

        var menuStyle = {
            position: 'fixed',
            bottom: '1px',
            width: '100%'
        }

        return (
        <div style={menuStyle}>
   
        <BottomNavigation>
            <BottomNavigationAction label="Recents" icon={<FiberManualRecordIcon />} />
            <BottomNavigationAction label="Favorites" icon={<FiberManualRecordIcon />} />
            <BottomNavigationAction label="Nearby" icon={<FiberManualRecordIcon />} />
        </BottomNavigation>
            
        </div>
            );
    }
}
 
export default Menu;
